import React, { lazy } from "react";
import { Route, Switch } from "react-router-dom";

const LandingPage = lazy(() => import("./components/LandingPage"));

function Routes() {
  return (
    <Switch>
      <Route exact path="/" to="/landing-page">
        <LandingPage />
      </Route>
    </Switch>
  );
}

export default Routes;
